import React from 'react';
import './Menu.css';

const MenuNavigation = () => {
    return (
        <div className='menu__nav nav'>
            <div className='nav__logo'></div>
            <div className='nav__links'>
                <ul className='nav__list'>
                    <li className='nav__item'>Steaks</li>
                    <li className='nav__item'>Burgers</li>
                    <li className='nav__item'>French fries</li>
                    <li className='nav__item'>Drinks</li>
                    <li className='nav__item'>Gdzie dowozimy?</li>
                    <li className='nav__item'>Kontakt</li>
                </ul>
            </div>

        </div>
    )
}

export default MenuNavigation;
